import { Component, OnInit } from '@angular/core';
import { Needs } from 'src/app/needs';
import { FundingBasket } from 'src/app/fundingbasket.service';
import { NEEDS } from 'src/app/mock-needs';

@Component({
  selector: 'app-helper-page',
  templateUrl: './helper-page.component.html',
  styleUrls: ['./helper-page.component.scss']
})
export class HelperPageComponent implements OnInit {

  needs: Needs[] = NEEDS;

  constructor(public fundingBasket: FundingBasket) {}

  ngOnInit(): void {
    this.getNeeds();
  }

  onSelect(need: Needs): void {
  }

  getNeeds(): void {
    this.fundingBasket.getAllNeeds().subscribe(needs => this.needs = needs);
  }
}
<!-- helper-page.component.html -->

<h2>Needs</h2>

<ul class="needs-list">
  <li *ngFor="let need of needs">
    <button (click)="onSelect(need)">
      <span class="badge">{{ need.name.charAt(0) }}</span>
      <span class="name">{{ need.name }}</span>
    </button>
  </li>
</ul>

<div *ngIf="selectedNeed">
  <h2>{{ selectedNeed.name }} details!</h2>
  <div><span>Id: </span>{{ selectedNeed.id }}</div>
  <div><span>Name: </span>{{ selectedNeed.name }}</div>
</div>
